import { Link } from 'react-router-dom'

const MainHeader = () => {
    return (
        <header>
            <ul>
                <li>
                    <Link href="/welcome">Welcome</Link>
                </li>
                <li>
                    <Link href="/products">Products</Link>
                </li>
                <li>
                    <Link href="/">home</Link>
                </li>
            </ul>
        </header>
    )
};

export default MainHeader;
